const villagesConfig = [
  {
    name: "מרג'ה",
    id: "marga",
  },
  {
    name: "איבתאן",
    id: "ibtan",
  },
  {
    name: "ביר א סיכה",
    id: "biracika",
  },
  {
    name: "ימה",
    id: "yama",
  },
];

const sickPeopleByVillage = {};
const thresholdsConfig = {
  red: { color: "#f00f0f", min: 25, max: 100, label: "אדום" },
  orange: { color: "#f67c09", min: 10, max: 20, label: "אדום" },
  green: { color: "#12f321", min: 0, max: 10, label: "ירוק" },
};

function init() {
  initSvg();
  initThresholds();
  initVillages();
}

function initSvg() {
  const el = document.querySelector("svg");
  el.innerHTML = image + paths;
}

function initThresholds() {
  const wrapper = document.querySelector("#thresholds-wrapper");
  const divs = Object.keys(thresholdsConfig)
    .map(
      (key) => `
                    <div>
                        <h1>${thresholdsConfig[key].label}</h1>
                        <div>
                            <h4>צבע</h4>
                            <input
                                type="color"
                                onchange={updateThreshold(event)}
                                name="${key}"
                                data-type="color"
                                value="${thresholdsConfig[key].color}"
                            />
                        </div>
                        <div>
                            <h4>אחוז מקסימום</h4>
                            <input
                                type="number"
                                onchange={updateThreshold(event)}
                                name="${key}"
                                data-type="max"
                                value="${thresholdsConfig[key].max}"
                            />
                        </div>
                        <div>
                            <h4>אחוז מינימום</h4>
                            <input
                                type="number"
                                onchange={updateThreshold(event)}
                                name="${key}"
                                data-type="min"
                                value="${thresholdsConfig[key].min}"
                            />
                        </div>
                    </div>
                `
    )
    .join("");
  wrapper.innerHTML = divs;
}

function initVillages() {
  villagesConfig.forEach((config) => {
    sickPeopleByVillage[config.id] = 0;
  });
  updateSvg();
  const villagesWrapper = document.querySelector("#villages-wrapper");
  const divs = villagesConfig
    .map(
      (config) => `
                    <div>
                        <h4>${config.name}</h4>
                        <input type="number" onchange={updateInput(event)} name="${
                          config.id
                        }" value="${sickPeopleByVillage[config.id]}" />
                    </div>
                `
    )
    .join("");
  villagesWrapper.innerHTML = divs;
}

function updateSvg() {
  const total = Object.keys(sickPeopleByVillage).reduce(
    (prev, curr) => prev + sickPeopleByVillage[curr],
    0
  );
  Object.keys(sickPeopleByVillage).forEach((villageName) => {
    const el = document.querySelector(`path#${villageName}`);
    const percent =
      total !== 0 ? (sickPeopleByVillage[villageName] / total) * 100 : 0;
    const relevantColor = getRelevantColor(percent);
    el.setAttribute("fill", relevantColor);
  });
}

function getRelevantColor(sicks) {
  const relevantCategory = Object.keys(thresholdsConfig).find(
    (category) =>
      sicks >= thresholdsConfig[category].min &&
      sicks <= thresholdsConfig[category].max
  );
  return thresholdsConfig[relevantCategory ? relevantCategory : "red"].color;
}

function toggleSettingVisibility() {
  const el = document.querySelector("#thresholds-wrapper");
  if (el.classList.contains("hidden")) {
    el.classList.remove("hidden");
  } else {
    el.classList.add("hidden");
  }
}

function updateInput(e) {
  sickPeopleByVillage[e.target.name] = JSON.parse(e.target.value);
  updateSvg();
}

function updateThreshold(e) {
  const type = e.target.dataset.type;
  const trafficLightColor = e.target.name;
  const value = type !== "color" ? JSON.parse(e.target.value) : e.target.value;
  thresholdsConfig[trafficLightColor][type] = value;
  updateSvg();
}

function downloadColoredMap() {
  const svgEl = document.querySelector("svg");
  const name = "VillagesStatus.png";
  svgEl.setAttribute("xmlns", "http://www.w3.org/2000/svg");
  const svgData = svgEl.outerHTML;
  const preface = '<?xml version="1.0" standalone="no"?>\r\n';
  const svgBlob = new Blob([preface, svgData], {
    type: "image/svg+xml;charset=utf-8",
  });
  const svgUrl = URL.createObjectURL(svgBlob);
  const svgImage = document.createElement("img");
  document.body.appendChild(svgImage);
  svgImage.onload = function () {
    const canvas = document.createElement("canvas");
    canvas.width = svgImage.clientWidth;
    canvas.height = svgImage.clientHeight;
    const canvasCtx = canvas.getContext("2d");
    canvasCtx.drawImage(svgImage, 0, 0);
    const imgData = canvas.toDataURL("image/png");
    const pngImage = document.createElement("img");
    document.body.appendChild(pngImage);
    document.body.removeChild(svgImage);
    pngImage.src = imgData;
    URL.revokeObjectURL(svgUrl);
    const downloadLink = document.createElement("a");
    downloadLink.href = imgData;
    downloadLink.download = name;
    document.body.appendChild(downloadLink);
    downloadLink.click();
    document.body.removeChild(downloadLink);
    document.body.removeChild(pngImage);
  };
  svgImage.src = svgUrl;
}

const image = `<image
            xlink:href="data:image/png;base64,"
            height="614"
            width="906"
            y="-7"
            x="-54"
        />`;
